    "2016-02-26T22:17:43.397097",nt"name": "nodc-standard-product-gulf-of-mexico-hydrographic-data-and-marine-mammal-data-nodc-accessi",nt"isopen":
    false,nt"url": null,nt"notes": "This CD-ROM was produced in cooperation
    with the Texas A&M University (TAMU), Department of Oceanography. It includes hydrographic
    and marine mammal sighting data for the Gulf of Mexico. The marine mammal data is
    from the GulfCet Program sponsored by the U.S. Minerals Management Service and headquartered
    at the TAMU Galveston Campus.The files on this CD-ROM are divided into two data
    groups: AMU-GULFCET and TAMU-OCEANOGRAPHY. The TAMU-GULFCET hydrographic data were
    collected in 1992-1993 by researchers from the Texas Institute of Oceanography and
    TAMU-Galveston during the course of a field program to study the distribution and
    abundance of cetaceans (whales and dolphins) in the north-central and western Gulf
    of Mexico. The GULFCET/MAMMALS files contain cetacean sighting data from eight seasonal
    aerial surveys, four spring ship surveys conducted by the NOAA National Marine Fisheries
    Service, and seven TAMU ship surveys.The TAMU-OCEANOGRAPHY hydrographic data were
    collected over a broader area of the Gulf of Mexico during the period 1987-1995.
    The data have been drawn together from 46 cruises over the 9-year period and consist
    of CTD, XBT, and bottle data as well as some processed data parameters such as dynamic
    height and splined XBT data.Copies of this disc are currently available via the
    NCEI Online Store athttp://ols.nndc.noaa.gov:7777/plolstore/plsql/olstore.prodspecific?prodnum=W00007-CDR-S0001",nt"license_title":
